import styled from 'styled-components';

const style = styled.div`
	position: fixed;
	top: 0;
	width: 100%;
	padding: 0px 5rem 0px 1rem;

	background-color: #2b2b2b;
`;

export default Navbar = () => {
	return(
		<div></div>
	);
}
